(12, 'Tiêm phòng sởi', 1, , 12000.00, 'Để phòng bệnh sởi, trẻ cần được tiêm 2 mũi vắc xin. Mũi thứ nhất tiêm khi trẻ 9 tháng tuổi, mũi thứ hai tiêm khi trẻ 18 tháng tuổi. Nếu trẻ được tiêm đủ 2 mũi vắc xin sởi, tỉ lệ bảo vệ là 90-95%. Để chủ động phòng chống bệnh sởi, người dân cần đưa con em đến trạm y tế để tiêm vắc xin phòng sởi &#13;&#10;', '2024-09-29 00:58:19');
INSERT INTO `dichvutiemchung` (`id`, `ten_dich_vu`, `loai_dich_vu`, `anh_dich_vu`, `gia`, `mo_ta`, `ngay_tao`) VALUES
(13, 'Vắc xin viêm gan B', 3, , 300000.00, 'Không nên dùng Engerix B cho những đối tượng được biết là quá mẫn cảm với một trong các thành phần của vắc xin, hoặc những đối tượng có biểu hiện mẫn cảm với vắc xin ở lần tiêm trước.&#13;&#10;Nhiễm HIV không được xem là chống chỉ định đối với việc chủng ngừa viêm gan B.', '2024-09-29 01:01:54');
